import React, { Component } from 'react';
import { Redirect } from 'react-router-dom';

class Loading extends Component {
  render() {
    const { redirectTo } = this.props;
    const time = 5000;

    return (
      <div>
        <p> Carrengado ...</p>
        {
          setTimeout(() => (
            <Redirect to={ redirectTo } />
          ), time)
        }
      </div>

    );
  }
}

export default Loading;
